function setupAddressFields(setNumber) {
    const $region = $(`#region${setNumber}`);
    const $province = $(`#province${setNumber}`);
    const $city = $(`#city${setNumber}`);
    const $zipCodeInput = $(`#zipCode${setNumber}`);

    $region.on('change', function () {
        const selectedRegion = $(this).val();
        if (selectedRegion) {
            populateDropdown($province, address[selectedRegion]);
            $province.prepend($('<option selected disabled value="">Select Province</option>'));
        } else {
            clearDropdowns($province, $city, $zipCodeInput);
          

        }
    });

    $province.on('change', function () {
        const selectedRegion = $region.val();
        const selectedProvince = $(this).val();
        if (selectedProvince) {
            populateDropdown($city, address[selectedRegion][selectedProvince]);
            $city.prepend($('<option selected disabled value="">Select Town/Municipality</option>'));
        } else {
            clearDropdowns($city, $zipCodeInput);
         

        }
    });

    $city.on('change', function () {
        const selectedRegion = $region.val();
        const selectedProvince = $province.val();
        const selectedCity = $(this).val();
        if (selectedCity) {
            const zipCode = address[selectedRegion][selectedProvince][selectedCity];
            $zipCodeInput.val(zipCode || '');
        } else {
            $zipCodeInput.val('');
        }
    });

}

// Define the populateDropdown and clearDropdowns functions as shown in the previous response


// Function to populate a dropdown element with options
function populateDropdown($dropdown, options) {
    $dropdown.empty();
    for (const key in options) {
        $dropdown.append(`<option value="${key}">${key}</option>`);
    }
}

// Function to clear multiple dropdown elements and an input field
function clearDropdowns(...$elements) {
    for (const $element of $elements) {
        $element.empty();
    }
}

// Usage for multiple sets
setupAddressFields(1); // Set 1
setupAddressFields(2); // Set 2
setupAddressFields(3); // Set 2
setupAddressFields(4); // Set 2
setupAddressFields(5); // Set 2
setupAddressFields(6); // Set 2
